import React from 'react';
import { Route, Routes } from 'react-router-dom'
import ProtectedRoute from './components/routing/ProtectedRoute';
import Login from './components/views/pages/login/Login';
import Register from './components/views/pages/register/Register';
import AuthContextProvider from './context/AuthContext'
import './scss/style.scss'
const DefaultLayout = React.lazy(() => import('./layout/default'))
const loading = (
  <div className='pt-3 text-center'>
    <div className='sk-spinner sk-spinner-pulse'></div>

  </div>
)
function App() {
  return (
    <React.Fragment>
      <AuthContextProvider>
        <React.Suspense fallback={loading}>
          <Routes>
            <Route exact path='/' element={<DefaultLayout />} />
            <ProtectedRoute exact path='/login' element={<Login />} />
            <Route exact path='/register' element={<Register />} />

          </Routes>
        </React.Suspense>
      </AuthContextProvider>
    </React.Fragment>
  );
}

export default App;
